import React from "react";
import style from "../style/homepage.module.css";

export default function videoForm() {
  return (
    <>
      <div className={style.card}></div>
      <div className={style.textForm}>
        <div className={style.title}>대한민국 vs 가나</div>
      </div>
    </>
  );
}
